import React from "react";
import 'bootstrap/dist/css/bootstrap.css';

export default function Todos(){
    return(
        <>
           <div className="container">
                <div className="text-center fs-1 bg-dark text-white">
                Todo App
                </div>
                <div className="text-center p-5">
                    <button type="button" class="btn btn-lg btn-primary">Today</button>
                    <button type="button" class="btn btn-lg btn-secondary">Pending</button>
                    <button type="button" class="btn btn-lg btn-secondary">Overdue</button>
                </div>
           </div>
        </>
    )
}
